B.Kl=new A.bF("Sandra is the name, of one of our very own, Celebrated by a multitude not because she is a struggling girl but rather because she was a girl that stood for what she believed in; one day she would get sufficient education for a future she saw others with.\n            \nCovered by NTV and other stories, Sandra's background started with dropping out of school which followed working for her aunt in a bar. With hope of being paid and therefore salvaging that for school, she was cheated by an adult that always amalgamated many factord to show her that she was more suited for marriage that what she imagined.\n            \nWhile fighting and being considered dissentient of a common African societal mentality, Sandra hanged in there to the day she met a male individual that presented an interesting opportunity of education with no strings attached to it, headed by Mr. Emmanuel Wanyama, the Pure Heart Child Foundation Uganda.\n            \nHaving heard her story, her cries landed on fertile ground to hold a blossoming future she almost imagined but didn't believe. Sandra has grown to succeed in school and no wonder, a whole village comes together to celebrate this fight.\n",null,B.uX,B.H,null,null)
